import './App.css';
import colors from './Data/ColorData';

function App() {
  return (
    <div>
      <h1> Color List</h1>
      <hr />
      <ul>
        {colors.map((color => {
          return (
            <li key={color.hex}>{color.name}</li>
          )
        }))}
      </ul>
    </div>
  );
}

export default App;
